import logo from './logo.svg';
import './App.css';



function App() {
  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1>Welcome to React!</h1>
        <p>This is a basic React application.</p>
      </header>
    </div>
  );
}
